description:
例如：
引用JS等资源文件：@Html.ExfUI().Scripts().Settings(m=>
    {
        m.SetLang(Types.Lang.zh_CN);
        m.SetTheme(Types.Theme.Default);
        m.SetFolder("~/Scripts/exfui/");
        m.SetAuto(true);
    })
控件的实现：
@(Html.ExfUI()
    .ExfTabs("exftabs")
    .Options(e =>
    {
        e.OnLoad("ExfTabsLoad");
    })
    .Items(items =>
    {
        items.Add(e =>
        {
            e.Title("基础配置");
            e.Html(
            @<text>
                <p style="margin:10px;">dddd</p>
            </text>);
        });
        items.Add(e =>
        {
            e.Title("全局参数");
            e.Html("content");
        });
    })
)
